import UpdateInformationForm from "./UpdateInformationForm";

export default function Profile() {
    return (
        <div className="profile">
            <div className="update-form-container">
                <UpdateInformationForm />

                <div className="profile-request">
                    <h1>REQUEST</h1>
                    <p>YOU DON'</p>
                </div>
            </div>
        </div>
    )
}
